    <app-big-card
      layoutDirection="row-reverse"
      title="You can <span class='it'>easy afoord it</span>"

      imageUrl="../../assets/homePage/relation.png"
    ></app-big-card>
    <app-big-card
      layoutDirection="row"
      title="<span class='it'>You</span> first, then your teeth"

      </div>
